import React from "react";
import { Entry } from "../types";
import HealthCheckDisplay from "./HealthCheckEntry";
import HospitalDisplay from "./HospitalDisplay";
import OccupationalHealthcare from "./OccupationalHealthcareDisplay";

const EntryDetails: React.FC<{entry: Entry}> = ({entry})=>{
  const assertNever = (value: never): never => {
    throw new Error(
      `Unhandled discriminated union member: ${JSON.stringify(value)}`
    );
  };

  const showIconType=(type: string): "user md"|"stethoscope"|"hospital"=>{
    if(type === "OccupationalHealthcare"){
      return "stethoscope"
    }
    else if(type=== "Hospital"){
      return "hospital"
    }
    else{
      return "user md"
    }




  }
switch (entry.type) {
  case "HealthCheck":
    return (
      <HealthCheckDisplay showIconType={showIconType(entry.type)} entry={entry}/>
    );
  case "Hospital":
    return(
      <HospitalDisplay showIconType={showIconType(entry.type)}entry={entry}/>
    );
  case "OccupationalHealthcare":
    return(
      <OccupationalHealthcare showIconType={showIconType(entry.type)} entry={entry}/>
    )
  default:
    return assertNever(entry)
}

}
export default EntryDetails;
